import React from 'react';

function Appointment() {

  return (
    <form onSubmit={this.handleSubmit}>
        <label>
            First Name:
            <input type="text" value={firstName} onChange={ onChange }/>
        </label>
        <label>
            Last Name:
            <input type="text" value={lastName} onChange={ onChange }/>
        </label>
    </form>

  );
}

export default Appointment;
